SELECT selco_complaint_received_date as "Complaint Lodged On:Date:100",name as "Complaint ID:Link/Issue:150",selco_branch as "Branch:Data:100",selco_customer_id as "Customer ID:Link/Customer:150",selco_customer_full_name as "Customer Name:Data:150",selco_customer_contact_number as "Customer Contact Number:Data:100",selco_description_of_complaint as "Description Of The Complaint:Data:150",
selco_type_of_system as "System Type:Data:100",selco_capacity as "Capacity:Data:100",selco_service_branch_email_id
as "Service Branch Email ID:Data:100",subject as "Complaint Summary:Data:200",selco_complaint_priority as "Complaint Priority:Data:100" FROM `tabIssue` WHERE selco_complaint_received_date<( CURDATE() - INTERVAL 5 DAY ) AND ( workflow_state NOT IN ( "Complaint Closed By Branch","Complaint Closed By CSD","Complaint Cancelled","Complaint Rejected By CSD","Warranty Claim Format Raised - WC","Dispatch Pending From Godown") ) ORDER BY selco_complaint_received_date DESC;
